import axios from "axios";

export function EditCategory(OldName, NewName) {
  axios
    .post("http://127.0.0.1:8000/webKiosk/client/category/update/", {
      market_name: "S",
      old_name: `${OldName}`,
      new: `${NewName}`,
    })
    .then((response) => {
      console.log(response);
    });
}
